/* eslint-disable react/no-unescaped-entities */
import styled from 'styled-components';

import Navbar from '../../components/shared/Navbar';
import DragAndDropZone from './components/DragAndDropZone';
import KeywordSearch from './components/KeywordSearch';

const SplitScreenLayout = styled.div`
  display: flex;
  height: 50%;
  & > * {
    flex: 1;
  }
`;

const FindButton = styled.button`
  color: green;
  margin-left: auto;
  margin-right: auto;
  display: block;
  padding: 10px 29px;
`;

const Home = () => (
  <>
    <Navbar />
    <SplitScreenLayout>
      <h3>C.V keyword lookup</h3>
      <ol>
        <li>Upload multiple C.V's.</li>
        <li>Add terms to search for.</li>
        <li>Get C.V's that match the terms.</li>
      </ol>
      <DragAndDropZone />
      <KeywordSearch />
    </SplitScreenLayout>
    <FindButton> Find </FindButton>
  </>
);

export default Home;
